                        <p>As a benefit corporation, FLYJETS is committed to <b>doing well by doing good</b>, with all corporate duties and responsibilities directed to both shareholders and stakeholders.</p>
                        <p>In keeping with its mission, FLYJETS has established its FLYGreen Energy Initiative, whereby with each flight booking, FLYJETS offers additional FLYRewards - over and above the amount ordinarily granted with each flight - to those
