                WriteLiteral(@"ets, and/or fly with some amount of Sustainable Aviation Fuel (SAF), pending availability.</p>
                        <p>FLYJETS has also established The FLY Foundation, a non-profit with the mission of supporting aviation education, advancement in aviation and radio communication technology, and safe and sustainable flight.</p>
                        <p>We are looking forward to working together with you!</p>
